# Alexandrovka, Tuymazinsky District, Republic of Bashkortostan

}}
Alexandrovka () is a rural locality (a village) in Kandrinsky Selsoviet, Tuymazinsky District, Bashkortostan, Russia. The population was 62 in 2010. There is one street. It is located 31 km southeast of Tuymazy (the district's administrative centre) by road. Pervomayskoye is the nearest rural locality.
